var title_f42_30_43488="Calf stretch";
var content_f42_30_43488=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F65646&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F65646&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Flexibility exercise: Calf",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 374px; height: 306px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Because many people have tight calf muscles, it's important to stretch them.",
"    <ol>",
"     <li>",
"      Stand facing a wall slightly farther than arm's length from the wall, feet shoulder-width apart.",
"     </li>",
"     <li>",
"      Put your palms flat against the wall at shoulder height and shoulder-width apart.",
"     </li>",
"     <li>",
"      Step forward with right leg and bend right knee. Keeping both feet flat on the floor, bend left knee slightly until you feel a stretch in your left calf muscle. It shouldn't feel uncomfortable. If you don't feel a stretch, bend your right knee until you do.",
"     </li>",
"     <li>",
"      Hold position for 10 to 30 seconds, and then return to starting position.",
"     </li>",
"     <li>",
"      Repeat with left leg.",
"     </li>",
"     <li>",
"      Continue alternating legs for at least three to five times on each leg.",
"     </li>",
"    </ol>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Go4Life. National Institute on Aging at the National Institutes of Health. Available at: file://go4life.niapublications.org (Accessed December 2, 2011).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
