"   <img alt=\"UpToDate\" src=\"./../images/wk_utd-rgb.myextg\" width=\"220px\">",
"   </img>",
"  </div>",
"  <div id=\"printHeaderText\">",
"   Official reprint from  UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
