var title_f42_30_43495="Adult mosquitoes";
var content_f42_30_43495=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F82494&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F82494&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 562px\">",
"   <div class=\"ttl\">",
"    Adult Anopheline and Culicine mosquitoes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 542px; height: 585px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The head appendages of the adult mosquito consist of one proboscis (a serrated appendage used by female mosquitoes for extracting blood), a pair of antennae, and a pair of maxillary palps; these features require a microscope for visualization. The unique palp characteristics are the most reliable for differentiation between Anopheline and Culicine mosquitoes. Anopheline female palps are about the same length as the proboscis, while Anopheline male palps are club-shaped at the ends. Culicine female palps are shorter than the proboscis, and Culicine male palps are long with a tapered point.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from figures courtesy of Cheryl Whitehorn, MSc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
