" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Metastatic gastroenteropancreatic neuroendocrine tumors: Local options to control tumor growth",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Jennifer Ang Chan, MD, MPH",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Matthew Kulke, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Richard M Goldberg, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Deputy Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/30/43496/contributors\">",
"     Diane MF Savarese, MD",
"    </a>",
"    <br/>",
"   </div>",
"  </div>",
"  <div id=\"disclosures\">",
"   <a href=\"mobipreview.htm?42/30/43496/contributor-disclosure\" target=\"_blank\">",
"    Disclosures",
"   </a>",
"  </div>",
"  <div id=\"reviewProcess\">",
"   <span>",
"    All topics are updated as new evidence becomes available and our",
"   </span>",
"   <a href=\"/home/editorial-policy\" target=\"_blank\">",
"    peer review process",
"   </a>",
"   <span>",
"    is complete.",
"   </span>",
"  </div>",
"  <div id=\"literatureReviewDate\">",
"   <span class=\"emphasis\">",
"    Literature review current through:",
"   </span>",
"   Oct 2013.",
"   <span class=\"pipeSpace\">",
"    |",
"   </span>",
"   <span class=\"emphasis\">",
"    This topic last updated:",
"   </span>",
"   Apr 15, 2013.",
"  </div>",
"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H688217\">",
"    <span class=\"h1\">",
"     INTRODUCTION",
"    </span>",
"    &nbsp;&mdash;&nbsp;Neuroendocrine cells are distributed widely throughout the body, and neoplasms of these dispersed cells can arise at many sites.",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H1970242\">",
"    <span class=\"h2\">",
"     Classification and nomenclature",
"    </span>",
"    &nbsp;&mdash;&nbsp;Neuroendocrine tumors (NETs) arising at different sites within the body are classified according to their histologic features. While there are differences in terminology and grading for these tumors arising at different sites, all commonly used classification systems reflect a basic separation between more indolent, well differentiated tumors (which in the digestive system have been traditionally referred to as carcinoids and pancreatic neuroendocrine [islet cell] tumors) and far more aggressive poorly differentiated types that behave clinically more like small cell carcinoma of the lung. (See",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?6/32/6665?source=see_link&amp;anchor=H262522852#H262522852\">",
"     \"Metastatic gastroenteropancreatic neuroendocrine tumors: Presentation, prognosis, imaging, and biochemical monitoring\", section on 'Classification and nomenclature'",
"    </a>",
"    .)",
"   </p>",
"   <p>",
"    Poorly differentiated neuroendocrine carcinomas are often associated with a rapid clinical course, while well-differentiated NETs generally have a much better prognosis. However, there is a spectrum of aggressiveness for well-differentiated tumors. Even in the presence of liver metastases, some patients may survive for many years. Proliferative rate, as assessed by mitotic count",
"    <span class=\"nowrap\">",
"     and/or",
"    </span>",
"    Ki67 labeling index, is of prognostic significance, independent of tumor stage. The World Health Organization (WHO) classifies well-differentiated gastroenteropancreatic NETs into low-grade (G1) and intermediate grade (G2) categories based upon proliferative rate (",
"    <a class=\"graphic graphic_table graphicRef60365 \" href=\"mobipreview.htm?17/14/17644\">",
"     table 1",
"    </a>",
"    ) [",
"    <a class=\"abstract\" href=\"mobipreview.htm?42/30/43496/abstract/1\">",
"     1",
"    </a>",
"    ]. All poorly differentiated neuroendocrine tumors are high-grade (G3) neuroendocrine carcinomas. (See",
"    <a class=\"medical medical_review\" href=\"mobipreview.htm?6/40/6794?source=see_link&amp;anchor=H2474956#H2474956\">",
"     \"Pathology, classification, and grading of neuroendocrine tumors arising in the digestive system\", section on '2010 WHO classification'",
"    </a>",
"    .)",
"   </p>",
"   <p>",
"    This topic review will cover local treatment options for patients with well-differentiated metastatic gastroenteropancreatic NETs. Systemic treatment options to control tumor growth",
"    <span class=\"nowrap\">",
"     and/or",
"    </span>",
"    symptoms of hormone hypersecretion and for treatment for poorly differentiated gastroenteropancreatic NETs are discussed elsewhere, as are the clinical presentation, imaging, and biochemical monitoring for patients with advanced gastroenteropancreatic NETs; pathology and classification of gastroenteropancreatic NETs; clinical features of primary carcinoid tumors; diagnosis of carcinoid syndrome and tumor localization; the treatment of early stage carcinoids; bronchial carcinoids; localization and treatment of pancreatic islet cell tumors; evaluation and management of neuroendocrine tumors of unknown primary site; management of symptoms of the carcinoid syndrome; carcinoid heart disease; and functioning pancreatic islet cell tumors.",
"   </p>",
"   <p>",
"    <ul class=\"bulletCompact-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?38/46/39658?source=see_link\">",
