"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?6/32/6665?source=see_link\">",
"       \"Metastatic gastroenteropancreatic neuroendocrine tumors: Presentation, prognosis, imaging, and biochemical monitoring\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?6/40/6794?source=see_link\">",
"       \"Pathology, classification, and grading of neuroendocrine tumors arising in the digestive system\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?0/60/969?source=see_link\">",
