"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?3/34/3623?source=see_link\">",
"       \"Somatostatinoma\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?15/59/16311?source=see_link\">",
