var title_f42_30_43500="Strategies prevent VAP";
var content_f42_30_43500=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F69916&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F69916&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Strategies to prevent ventilator-associated pneumonia in acute care hospitals &mdash; Society for Healthcare Epidemiology of America/Infectious Diseases Society of America (SHEA/IDSA)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        General strategies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Conduct active surveillance for VAP.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adhere to hand-hygiene guidelines published by the Centers for Disease Control and Prevention or the World Health Organization.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use noninvasive ventilation whenever possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Minimize the duration of ventilation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perform daily assessments of readiness to wean and use weaning protocols.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Educate healthcare personnel who care for patients undergoing ventilation about VAP.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Strategies to prevent aspiration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maintain patients in a semirecumbent position (30&deg;-45&deg; elevation of the head of the bed) unless there are contraindications.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoid gastric overdistention.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoid unplanned extubation and reintubation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use a cuffed endotracheal tube with in-line or subglottic suctioning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maintain an endotracheal cuff pressure of at least 20 cm H",
"        <sub>",
"         2",
"        </sub>",
"        O.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Strategies to reduce colonization of the aerodigestive tract",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Orotracheal intubation is preferable to nasotracheal intubation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoid histamine receptor 2 (H2)-blocking agents and proton pump inhibitors for patients who are not at high risk for developing a stress ulcer or stress gastritis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perform regular oral care with an antiseptic solution. The optimal frequency for oral care is unresolved.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The appropriateness of selective digestive tract decontamination is an unresolved issue.*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Strategies to minimize contamination of equipment used to care for patients receiving mechanical ventilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use sterile water to rinse reusable respiratory equipment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove condensate from ventilatory circuits. Keep the ventilatory circuit closed during condensate removal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Change the ventilatory circuit only when visibly soiled or malfunctioning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Store and disinfect respiratory therapy equipment properly.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The use of selective digestive tract decontamination (SDD) is controversial, and is considered an unresolved issue by SHEA/IDSA. The major drawback of SDD is the possibility of promoting the growth of resistant bacteria. SDD is most beneficial in hospitals that have low rates of antibiotic resistance; rates of resistance should be considered before employing SDD.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from: Coffin SE, Klompas M, Classen D, et al. Strategies to prevent ventilator-associated pneumonia in acute care hospitals. Infect Control Hosp Epidemiol 2008; 29 Suppl 1:S31. Copyright &copy; 2008 University of Chicago Press.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.journals.uchicago.edu/\">",
"      file://www.journals.uchicago.edu/",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
